window.bookSummaryJSON = "<p><b>A Lycan that can’t shift is no use to anyone.</b></p> <p>I’ve made it my mission to be useful to my pack. As pack enforcer, I’m fast and strong, but when the time comes to bond with my mate, it isn’t enough.</p> <p>Rejection means lone wolf status and isolation from the pack. But when a package arrives with an unexpected inheritance, the pack that wants to shun me suddenly has a new use for me.</p> <p>Turns out, I’m the proud owner of a house in mysterious territory, rumored to be home to a pack of beautifully twisted shifters. Hawthorne Cove is impregnable to Lycans, but not to a half-human like me.</p> <p>Now I have a second chance to be accepted by my pack.</p> <p>All I have to do is infiltrate the Hawthorne pack, find the source of their power, and steal it.</p> <p>Easier said than done.</p> <p>Because once I pass the mystical boundaries surrounding the town, I’ll be absolutely and totally at the mercy of the wolves of Hawthorne Cove.</p>"; 
